--
-- Definition of function `GET_LATEST_POSITION_BY_ID`
--

DROP FUNCTION IF EXISTS `GET_LATEST_POSITION_BY_ID`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` FUNCTION `GET_LATEST_POSITION_BY_ID`(
_empid int
) RETURNS text CHARSET latin1
BEGIN

declare pos text;

SELECT position_ INTO pos FROM tblempposition
where empid=_empid and date_updated=
                                    (SELECT MAX(date_updated) from tblempposition where empid=_empid);

return pos;

END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

--
-- Definition of procedure `ATTENDANCE_BW_DATES`
--

DROP PROCEDURE IF EXISTS `ATTENDANCE_BW_DATES`;

DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `ATTENDANCE_BW_DATES`(
in _from datetime,
in _to datetime
)
BEGIN
Select CONCAT(e.lname, ", ", e.fname, " ", e.mname) as fullname, GET_LATEST_POSITION_BY_ID(e.empid) as position_ ,a.date_time, a.state, a.work_code
from tblemp e, tblattendance a where e.empid=a.empid and a.date_time between _from and _to;
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

