DELIMITER $$

/*!50003 SET @TEMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION' */ $$
CREATE DEFINER=`root`@`localhost` PROCEDURE `EMP_INSERT`(
IN _empid int(20),
IN _fname varchar(45),
IN _lname varchar(45),
IN _mname varchar(45),
IN _gender varchar(10),
IN _contactno varchar(45),
IN _address varchar(200),
IN _emp_status varchar(45),
IN _emp_position varchar(45),
IN _branchid int(11),
IN _imagearr longblob,
in _imagesize long,
in _bdate date
)
BEGIN
VALUES(_empid,_fname,_lname,_mname,_gender,_contactno,_address, _bdate);

CALL EMP_POSITION_INSERT(_empid, _emp_position);

CALL EMP_STATUS_INSERT(_empid, _emp_status);

CALL EMP_PIC_INSERT(_empid, _imagearr, _imagesize);

CALL EMP_BRANCH_ASSIGNMENT_INSERT(_empid,_branchid);
END $$
/*!50003 SET SESSION SQL_MODE=@TEMP_SQL_MODE */  $$

DELIMITER ;

